import React, { Component } from "react";
import clip from "../public/videos/clip.mp4";

class Video extends Component {
  render() {
    return (
      <div>
        <video src={'/public/videos/clip.mp4'} type="videos.mp4" />
      </div>
    );
  }
}

export default Video;
